"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Neutropenia (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/neutropenia-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H25416744\">",
"      <span class=\"h1\">",
"       What is neutropenia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Neutropenia is condition that happens when your blood has a very small amount of cells called &ldquo;neutrophils.&rdquo; Neutrophils are a type of white blood cell. They help your body fight infections.",
"     </p>",
"     <p>",
"      Blood is made up of different types of cells. These cells are made in the middle of your bones, in a part called the bone marrow. Neutropenia can happen if:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Your bone marrow doesn&rsquo;t make enough white blood cells.",
"       </li>",
"       <li>",
"        Something in your body (such a medicine you took) destroys some of your white blood cells.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Some people with neutropenia have no symptoms. But people with severe neutropenia can get fevers and frequent infections, often in the mouth and the lungs.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H25416759\">",
"      <span class=\"h1\">",
"       What causes neutropenia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Many different things can cause neutropenia, including:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Infections &ndash; Many different infections can cause neutropenia, including:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Typhoid fever",
"       </li>",
"       <li>",
"        Tuberculosis",
"       </li>",
"       <li>",
"        Hepatitis B",
"       </li>",
"       <li>",
"        HIV, the virus that causes AIDS",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Medicines &ndash; The most common examples include:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Medicines used to treat cancer, such as",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?6/25/6550?source=see_link\">",
"         cyclophosphamide",
"        </a>",
"        (brand name: Cytoxan) and",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?29/52/30533?source=see_link\">",
"         doxorubicin",
"        </a>",
"        (brand name: Adriamycin)",
"       </li>",
"       <li>",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?8/41/8854?source=see_link\">",
"         Clozapine",
"        </a>",
"        (brand names: Clozaril, FazaClo)",
"       </li>",
"       <li>",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?12/24/12677?source=see_link\">",
"         Sulfasalazine",
"        </a>",
"        (brand name: Azulfidine)",
"       </li>",
"       <li>",
"        Ticlodipine (brand name: Ticlid)",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Problems with your infection-fighting system &ndash; The body&rsquo;s infection-fighting system is also called the &ldquo;immune system.&rdquo; Normally, the immune system kills germs and other bad cells that could turn into cancer. But sometimes, the immune system attacks healthy cells, including white blood cells. This condition is known as &ldquo;autoimmune neutropenia.&rdquo;",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H25416773\">",
"      <span class=\"h1\">",
"       Will I need tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your doctor or nurse will decide which tests you should have based on your age, other symptoms, and individual situation.",
"     </p>",
"     <p>",
"      Here are the most common tests doctors use to find the cause of neutropenia:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        A blood test that looks at all the different types of white blood cells in your blood. It is called a &ldquo;complete blood count with white blood cell differential&rdquo; or &ldquo;CBC with diff.&rdquo;",
"       </li>",
"       <li>",
"        Bone marrow biopsy &ndash; A doctor will take a very small sample of the bone marrow. Then another doctor will look at the cells under a microscope.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H25416788\">",
"      <span class=\"h1\">",
"       How is neutropenia treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The treatment depends on what caused you to get neutropenia.",
"     </p>",
"     <p>",
"      If your neutropenia was caused by a medicine you took, your doctor might have you stop taking the medicine. He or she might be able to switch you to a different medicine that is less likely to cause the problem.",
"     </p>",
"     <p>",
"      Your doctor might also prescribe drugs that help your bone marrow make white blood cells. These drugs are given in a shot and include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?21/22/21861?source=see_link\">",
"         Filgrastim",
"        </a>",
"        (brand name: Neupogen)",
"       </li>",
"       <li>",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?25/6/25700?source=see_link\">",
"         Sargramostim",
"        </a>",
"        (brand name: Leukine)",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H336862930\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?5/26/5537?source=see_link\">",
"       Patient information: Complete blood count (CBC) (The Basics)",
"      </a>",
"     </p>",
