var title_f24_59_25534="Therapy approach MM II";
var content_f24_59_25534=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F79012&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F79012&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 601px\">",
"   <div class=\"ttl\">",
"    Approach to therapy in patients with multiple myeloma not eligible for transplantation",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 581px; height: 143px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    <strong>",
"     High risk",
"    </strong>",
"    : Patients with t(14;16), t(14;20), or del17p13 by FISH or high risk gene expression profiling signature.",
"    <br>",
"     <strong>",
"      Intermediate risk",
"     </strong>",
"     : Patients with t(4;14) by FISH or deletion 13/hypodiploidy by conventional cytogenetics.",
"     <br>",
"      <strong>",
"       Standard risk",
"      </strong>",
"      : All patients with myeloma who lack any of the high or intermediate risk genetic abnormalities described above.",
"      <div class=\"footnotes\">",
"       * Usual treatment duration is approximately 12 to 18 months.",
"       <br/>",
"       <span class=\"bullet\">",
"        &bull;",
"       </span>",
"       In patients treated with Rd, continuing treatment beyond 12 months is an option for patients responding well with low toxicities; dexamethasone is usually discontinued after first year.",
"      </div>",
"      <div class=\"reference\">",
"       Modified from: Rajkumar SV. Treatment of multiple myeloma. Nat Rev Clin Oncol 2011; 26:479.",
"      </div>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
